import MenuTopo from "./componentes/MenuTopo";
import Botao from "./componentes/Botao";

function App() {

  const jogos = [
    {
      nome: 'jogo 1'
    },
    {
      nome: 'jogo 2'
    },

  ]

  return (
    <div className="App">
      <MenuTopo/>
      <Botao nome={jogos.map('', 0)}/>
    </div>
  );
}

export default App;
